(17, 'Ahmad Eka Saputra', 'a.ekapramudiasaputra@gmail.com', 'Penawaran Jasa SEO Halaman 1 Google.co.id', 'Salam,\r\n\r\nPerkenalkan Saya Eka dari RAZQA.COM yang merupakan Jasa Pembuatan Website & Jasa SEO.\r\n\r\nSaya bermaksud memberikan penawaran kepada Anda berupa Jasa SEO Bergaransi untuk meningkatkan posisi website Anda di halaman pencarian Google.co.id, sehingga website Anda dapat menduduki posisi yang Baik di Halaman Pertama Google.\r\n\r\n# LANGKAH SEO\r\n\r\nLangkah 1 : Evaluation & Planning\r\n\r\n- Catatan Rank berdasarkan Keyword\r\n- Seleksi halaman website untuk dioptimalisasiÂ \r\n- Konfigurasi Google Webmaster (Search Console)\r\n- Pre-optimalisasi submit sitemap.xml ke Search Engine\r\n\r\nLangkah 2 : Execution\r\n\r\n- SEO onpage: Konfigurasi Meta Tag, Konfigurasi Image Alt & Anchor Title Tag, Internal Link Management, Konfigurasi Robots.txt & Memasang Code Image & .js Compressor .htaccess via cPanel\r\n- Existing Content Optimization (revisi dari existing content) via Web Admin\r\n- SEO offpage: Backlink Building\r\n\r\nLangkah 3 : Quality Check (QC)\r\n\r\nLangkah 4 : Completion\r\n\r\n- Submit sitemap.xml ke Search Engine\r\n\r\nLangkah 5 : Monitoring\r\n\r\n- Ranking MonitoringÂ \r\n- Laporan Komplit\r\n\r\n\r\n# BIAYA\r\n\r\n- 1 Keyword : Rp800.000 /Keyword\r\n- 5 Keyword : Rp600.000 /Keyword\r\n- 10 Keyword : Rp400.000/Keyword\r\n\r\n# LAMA PENGERJAAN\r\n\r\n- 90 Hari Kerja.\r\n\r\n# GARANSI\r\n\r\n- Garansi Uang Kembali 50% apabila Website tidak masuk ke Halaman Pertama Google dalam waktu 90 Hari.\r\n\r\n# KONTAK\r\n\r\n- CALL : 08128910351\r\n- WA : 083804414600\r\n\r\n\r\nSekian penawaran Saya, apabila masih terdapat banyak kekurangan Saya mohon maaf.\r\n\r\nSalam', '2017-05-06'),
(18, 'adrian hastika', 'adrianhastika@gmail.com', 'perihal permintaan penawaran harga kerjasama', 'sy Adrian Ubaya Surabaya..\r\nubaya akan mngadkan pmeran pndidikan...design msing2 udh ada..pmeran d skolah SMA Petra.. 5 petra brturut2 slma 5hri mulai 10agustus17,..\r\nqt bw smua jurusan... jd btuh 19 booth kcil ukuran 2x1 n 1 booth besar 5 x 3.. kira2 ap qt bs dkasi layoutnya bgusnya gmn? susunan posisinya... acra d masing2 lapangan basket SMA PEtra. kami krg mngerti bgus susunannya gmn spy pgunjung yg dtg jg enk kliling n mndapat informasi pndidikannya..', '2017-07-17'),
(19, 'Anggi Andikha (Mr.)', 'anggi.andikha@multimyaka.co.id', 'Confirm company Profile Asimetris', 'Dear Bapak / Ibu Marketing Asimetris,\r\n\r\nSaya ditugaskan untuk menanyakan Company Profile dari perusahaan Asimetris.\r\nMohon kiranya Bapak / Ibu Marketing Asimetris dapat mengirimkan Company Profile Asimetris.\r\nSaya tunggu konfirmasinya.\r\ndapat hubungi di +62 21 468 32522 ext. 1246 / 081282227047\r\n\r\n\r\nTerima kasih.\r\n', '2017-10-10'),
(20, 'cecilia septiana', 'ceciliaseptiana.zap@gmail.com', 'Brief Booth Zap Clinic', 'Boleh dikirimkan alamat email untuk mengirimkan brief Booth Zap Clinic untuk event jawa post di surabaya atau contact personnya. Terima kasih', '2018-03-13'),
(21, 'Rizky', 'mayriz80@gmail.com', 'Penawaran Booth Exhibition', 'Please bisa di buatkan design & penawaaran booth uk. 9x5m, untuk event pameran expo, \r\nbudget sekitar 25-28Jt, mngkin bs disesuaikan budget saya u/ designnya tidak harus full uk.9x5m.\r\ndi tunggu responnya.\r\nthanks, ', '2018-08-20');
